import React, { Component } from 'react';
import { BrowserRouter } from 'react-router-dom';
import Login from '../../containers/Login'
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>Mentor Match</h1>
          <Login />
          <button>button</button>
        </header>
      </div>
    );
  }
}

export default App;
